import React from 'react'
import Button, { ButtonProps }  from '@mui/material/Button';
import { useNavigate } from "react-router-dom";

import './More.css'
import { styled } from '@mui/material/styles';
import Stack from '@mui/material/Stack';
import { purple } from '@mui/material/colors';

function More() {
  let navigate = useNavigate(); 
  const routeChange = () =>{ 
    let path = `https://cnu.edu/police/`; 
    navigate(path);
  }


const BootstrapButton = styled(Button)({
  boxShadow: 'none',
  textTransform: 'none',
  fontSize: 16,
  padding: '6px 12px',
  border: '1px solid',
  lineHeight: 1.5,
  backgroundColor: '#0063cc',
  borderColor: '#0063cc',
  fontFamily: [
    '-apple-system',
    'BlinkMacSystemFont',
    '"Segoe UI"',
    'Roboto',
    '"Helvetica Neue"',
    'Arial',
    'sans-serif',
    '"Apple Color Emoji"',
    '"Segoe UI Emoji"',
    '"Segoe UI Symbol"',
  ].join(','),
  '&:hover': {
    backgroundColor: '#0069d9',
    borderColor: '#0062cc',
    boxShadow: 'none',
  },
  '&:active': {
    boxShadow: 'none',
    backgroundColor: '#0062cc',
    borderColor: '#005cbf',
  },
  '&:focus': {
    boxShadow: '0 0 0 0.2rem rgba(0,123,255,.5)',
  },
});

const ColorButton = styled(Button)<ButtonProps>(({ theme }) => ({
  color: theme.palette.getContrastText(purple[500]),
  backgroundColor: purple[500],
  '&:hover': {
    backgroundColor: purple[700],
  },
}))


  return (
   
    <div className="page">
    <h1 className='header'>Could be anything</h1>
    <p>
      maybe instructions?
    </p>
    <section>
      {/* <div className="buttons-wrapper"> */}
      <ColorButton variant="contained" className='buttons-fun'> Report a Crime</ColorButton>
          <Button variant="contained" className='buttons-fun'>Report a Crime-Anonymous</Button>
          <Button  variant="contained"className='buttons-fun'>Contact PD anonymous</Button>
          <Button  className='buttons-fun' >Citizen contribution</Button>
          <Button  variant="contained"  className='buttons-fun'> Request Escort</Button>
          <Button  variant="contained" className='buttons-fun'>Campus Map</Button>
          <Button variant="contained" className='buttons-fun'>View Your Reports</Button>
          <Button  variant="contained" className='btn-securityresource'
             href="/securityreources">Security Resources</Button>
          <Button variant="contained" className='buttons-fun'>Bordered Button</Button>
      {/* </div> */}
    </section>

 
  </div>
  )
}

export default More
